import { useState, useEffect } from "react";
import OfferService from "../../services/offer.service";

export const Search = () => {
  const [offers, setOffers] = useState([]);

  const onSearch = (e) => {
    e.preventDefault();
  };

  const vehicleIdentificationNumber = 123;
  const model = "Ameo";

  const data = {
    model,
  };

  console.log(data);
  console.log(offers);

  useEffect(() => {
    OfferService.searchOffer(data).then((offer) => setOffers(offer.data));
  }, []);

  return (
    <div className="container mt-5">
      <div className="row d-flex justify-content-center">
        <div className="col-md-10">
          <div className="card p-3  py-4">
            <h5>An Easier way to find your Housing</h5>
            <form method="GET" onSubmit={onSearch}>
              <div className="row g-3 mt-2">
                <div className="col-md-3">
                  <div className="dropdown">
                    <button
                      className="btn btn-secondary dropdown-toggle"
                      type="button"
                      id="dropdownMenuButton"
                      data-toggle="dropdown"
                      aria-expanded="false"
                    >
                      Any Status
                    </button>
                    <ul
                      className="dropdown-menu"
                      aria-labelledby="dropdownMenuButton"
                    >
                      <li>
                        <a className="dropdown-item" href="/">
                          Rural
                        </a>
                      </li>
                      <li>
                        <a className="dropdown-item" href="/">
                          Urban
                        </a>
                      </li>
                      <li>
                        <a className="dropdown-item" href="/">
                          All
                        </a>
                      </li>
                    </ul>
                  </div>
                </div>

                <div className="col-md-6">
                  <input
                    type="text"
                    className="form-control"
                    placeholder="Enter address e.g. street, city and state or zip"
                  />
                </div>

                <div className="col-md-3">
                  <button className="btn btn-secondary btn-block">
                    Search Results
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};
